(1847, 'Отчет', 487, 1, 0, '2017-11-30 11:10:49', '2017-12-05 04:40:22', 'Не знаю как отправить...даже скриншот не отправляет((('),
(1848, 'Приглашение в Telegram (официальный канал проекта)', 464, 1, 1, '2017-12-01 07:09:04', '2017-12-04 04:48:01', 'Здравствуйте. Уже присоединился...'),
(1849, 'Комплимент в виде 500 ReforMoney', 620, 1, 1, '2017-12-01 08:51:44', '2017-12-04 04:47:47', 'Здравствуйте, "либо просто забрать их через свой кошелек WebMoney" вот тут вы пишите что я смогу вывести, но мне говорят что ты должен купить задание, но я не знаю как купить задания, не могли бы вы мне сказать, и как все таки вывести. С уважением ваш пользователь.'),
(1850, 'Ошибка', 620, 1, 0, '2017-12-01 10:02:35', '2017-12-04 01:05:49', 'Здравствуйте,   у меня возникла проблема, при заливание видео размером 6 мб мне говорит, что ошибка и файл свыше 100мб'),
(1851, 'Комплимент в виде 500 ReforMoney', 606, 1, 1, '2017-12-02 06:29:56', '2017-12-04 04:47:42', 'Спасибо большое вам ) неподвиду я обожаю спорт и ещё у я что тотне погу подключить mail.ru мне скзали связаться с вами'),
(1852, 'Приглашение в Telegram (официальный канал проекта)', 606, 1, 1, '2017-12-02 06:30:39', '2017-12-04 04:47:39', 'Я уже там спасибо за приглашение'),
(1853, 'Иммунитеты', 8, 1, 0, '2017-12-03 10:41:41', '2017-12-04 01:06:23', 'Добрый вечер,\r\n\r\nХотела бы уточнить 2 вопроса:\r\n1) В чем отличие "Необязательного дня тренировок" от "Обязательного"?\r\n2) Вчера я пропустила тренировку (не сдала отчет до 22:00), и заметила сегодня, что у меня использованы 2 иммунитета. В каком соотношении используются иммунитеты за пропуск 1-го занятия? (до вчера у меня были вовремя сданы отчеты).\r\n\r\nСпасибо,\r\nКатерина'),
(1854, 'Не загружается отчет.', 654, 1, 0, '2017-12-03 14:42:35', '2017-12-04 01:06:52', 'При загрузки отчета, пишет ошибку. Привышен размер в 100мб. Хотя мой отчет весит 2мб. Как мне отправить отчет？'),
(1855, 'Не могу загрузить отчет', 3, 0, 499, '2017-12-05 04:39:54', '2017-12-05 04:39:54', 'Добрый день!\r\nПростите за долгий ответ, исправляли ошибки.\r\nВы можете повторно загрузить отчет (если не получается, попробуйте с другого устройства).'),
(1856, 'Отчет', 3, 1, 487, '2017-12-05 04:40:16', '2017-12-11 03:21:27', 'Добрый день!\r\nПростите за долгий ответ, исправляли ошибки.\r\nВы можете повторно загрузить отчет (если не получается, попробуйте с другого устройства).'),
(1857, 'Ошибка', 3, 1, 620, '2017-12-05 04:40:34', '2017-12-05 10:09:20', 'Добрый день!\r\nПростите за долгий ответ, исправляли ошибки.\r\nВы можете повторно загрузить отчет (если не получается, попробуйте с другого устройства).'),
(1858, 'Иммунитеты', 3, 1, 8, '2017-12-05 04:44:46', '2017-12-05 04:50:45', 'Добрый день!\r\nПростите за долгий ответ.\r\n1. По обязательному дню нужно обязательно отправлять отчет.\r\n2. 1 день - 1 иммунитет. У нас нигде нет автоматического снятия иммунитетов. Его списать можно, только разблокировав кабинет.'),
(1859, 'Не загружается отчет.', 3, 1, 654, '2017-12-05 04:45:39', '2017-12-07 16:40:58', 'Добрый день! Простите за долгий ответ, исправляли ошибки. Вы можете загрузить отчет. (если не получается, попробуйте с другого устройства).'),
(1860, 'Не загружается отчет.', 146, 0, 654, '2017-12-19 12:05:47', '2017-12-19 12:05:47', 'Добрый день!\r\nПопробуйте еще раз, вообще таких проблем уже не должно возникать.'),
(1861, 'Иммунитеты', 146, 0, 8, '2017-12-19 12:06:48', '2017-12-19 12:06:48', 'Добрый день!\r\nПо необязательным тренировкам необязательно присылать отчеты (из-за этого личный кабинет не заблокируется).\r\nСпасибо!'),
(1862, 'Ошибка', 146, 1, 620, '2017-12-19 12:07:19', '2018-01-11 08:25:42', 'Добрый день!\r\nПопробуйте еще раз, по идее таких проблем более не должно возникать!'),
(1863, 'Отчет', 146, 1, 487, '2017-12-19 12:07:33', '2018-01-11 08:57:35', 'Добрый день!\r\nПопробуйте еще раз, по идее таких проблем более не должно возникать!'),
(1864, 'Не могу загрузить отчет', 146, 0, 499, '2017-12-19 12:07:52', '2017-12-19 12:07:52', 'Добрый день!\r\nПопробуйте еще раз, по идее таких проблем более не должно возникать!'),
