INSERT INTO `programms` (`id`, `slug`, `name`, `created_at`, `updated_at`, `cost`, `description`, `days`, `trainings`, `day_off`, `tasks`, `status`, `logo`, `lite`) VALUES
(1, 'r.one_start', 'R.ONE START', '2018-01-10 09:49:13', '2018-01-10 09:49:13', 2500.00, 'Программа тренировок подойдет для всех вне зависимости от уровня подготовки, в том числе для новичков или тех, кто очень давно не занимался спортом и только сейчас готов стать реформатором. Попробуйте бесплатно в течение тестового периода.', 28, 9, 9, 10, 1, '/image/program/r.one_start.png', 0),
(2, 'r.one_pro', 'R.ONE PRO', '2018-01-10 09:49:13', '2018-01-10 09:49:13', 2500.00, 'Программа предназначенная для Про', 28, 9, 9, 10, 0, '/image/program/r.one_pro.png', 0),
(3, 'r.one_runner', 'R.ONE RUNNER', '2018-01-10 09:49:13', '2018-01-10 09:49:13', 2500.00, 'Программа предназначенная для бега.', 28, 9, 9, 10, 0, '/image/program/r.one_run.png', 0),
(4, 'r.one_runner_plus', 'R.ONE RUNNER +', '2018-01-10 09:49:13', '2018-01-10 09:49:13', 2500.00, 'Программа предназначенная для бега с бонусами', 28, 9, 9, 10, 0, '/image/program/r.one_run+.png', 0),
(5, 'r.one_power', 'R.ONE POWER', '2018-01-10 09:49:13', '2018-01-10 09:49:13', 2500.00, 'Программа предназначенная для самых сильных', 28, 9, 9, 10, 0, '/image/program/r.one_power.png', 0),
(6, 'r.one_lite', 'R.ONE Lite', '2018-01-10 09:49:13', '2018-01-10 09:49:13', 2500.00, 'Программа тренировок по лайт-цене для всех, кто хочет попробовать свои силы и не любит отправлять отчеты, а также кто хочет больше внимания уделить бонусной системе', 28, 8, 10, 11, 1, '/image/program/r.one_lite.png', 1);
INSERT INTO `programm_days` (`id`, `day`, `status`, `programm_id`, `created_at`, `updated_at`, `difficult`, `interest`, `lead_time`, `description`, `feed`, `free_day`) VALUES
(1, 1, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 1, '< 20 мин', '1-й день программы тренировок задействует все основные мышцы в организме и сегодня контрольный тест – все упражнения делаете по максимуму, сколько сможете.\nПеред выполнением всех упражнений сразу или по отдельности рекомендуется сделать общую разминку, а после окончания выполнения тренировки – растяжку.', 'Начинаем неспешно , но продуктивно!) Кушаем в первый день маленькими порциями, стараемся есть больше белка (яйца, творог, сыр). Обедаем и ужинаем очень легко. Из мяса желательно кролик, курица или рыба. От гарнира желательно отказаться, заменить растительным белком (зелёная фасоль, бобовые). Перекусываем после тренировки молочным коктейлем или орехами.', 1),
(2, 2, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 1, 0, '< 20 мин', 'Вспомогательная тренировка для укрепления всего организма. Развивается общая выносливость и помощь в ускорении обмена веществ. Каждое упражнение выполняется в течение 1 минуты.', 'Перед тренировкой, за час - скушайте кусок чёрного зернового хлеба с чаем/водой. Это даст вас углеводный запас и энергию для Старта!) После тренировки (через мин 15)  желательно выпить молочный коктейль/фрукт или же выпить свежевыжатый сок . Все это пополнит запас гликогена быстро и безвредно для фигуры', 1),
(3, 3, 0, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 0, 0, '', 'Выходной', 'Даём мышцам отдых и восстанавливаем баланс полиненасыщенных жиров. Добавляем в еду ягоды/орехи. Больше томатов. И стараемся воздержаться от ужина в этот день.', 0),
(4, 4, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 1, 0, '< 20 мин', 'Тренировка направлена на укрепление мышц ног и пресса.', 'Нагрузка на ноги, поэтому больше пьём воды! Перед тренировкой за час выпить стакан чёрного кофе или крепкий зелёный чай. После тренировки хорошо будет перекусить творогом (не жирный 5%) с 2-3 ч ложками мёда.', 0),
(5, 5, 0, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 0, 0, '', 'Выходной', 'Отдыхаем. В обед/ужин лучше всего красное мясо или бобовые/соя. Прием пищи 4 раза в день, НО маленькими порциями.  Кто хочет набрать мышечную массу, то 3 раза в день, стандартными порциями.', 0),
(6, 6, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 1, '< 40 мин', 'Более глубокая проработка мышечной ткани и хороший жиросжигательный эффект!', 'Помним! Жир горит с 20 минуты! Тренируемся умеренно, но продолжительно. Увеличиваем количество белка ДО и ПОСЛЕ тренировки. Исключаем в этот день сладкое полностью. Желательно отказаться от гарнира в пользу зелени.', 0),
(7, 7, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 0, '< 30 мин', 'Легкое повышение нагрузки на организм, переход на следующую ступень', 'Перед тренировкой, за час - скушайте кусок чёрного зернового хлеба с чаем/водой. Это даст вас углеводный запас и энергию для Старта!) После тренировки (через мин 15)  желательно выпить молочный коктейль/фрукт или же выпить свежевыжатый сок. Пополняем запасы гликогена в мышцах и даём витаминчиков.', 0),
(8, 8, 0, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 0, 0, '', 'Выходной', '««Важно не то, насколько усердно вы тренируетесь, а насколько полноценно вы отдыхаете». В этот день исключаем углеводы и животные жиры. Кушаем белок и растительные жиры (орехи/арахис/семена льна/вишня).».', 0),
(9, 9, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 1, '< 40 мин', 'Тренировка направлена на укрепление верхнего плечевого пояса и мышц пресса.', 'Животик должен быть плоским! Утром - стакан кефира/киселя. После тренировки еще один стакан кефира. Кушаем 3 раза в день и уходим с чувством "голода". Тратим ненужные отложения. На ночь - снова стакан кефира.', 0),
(10, 10, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 0, '< 30 мин', '10-й день тренировки помогает поддерживать общий тонус ваших мышц', 'Увеличиваем количество животного белка, особенно мясо/птица. Гарнира не более 2 столовых ложек на порцию.', 0),
(11, 11, 0, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 0, 0, '', 'Выходной', 'Отдыхаем. Пьём много воды в этот день. Исключаем мясо, едим гарнир (кроме картофеля)  и зелень.', 0),
(12, 12, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 1, 0, '< 40 мин', '12-й день тренировки помогает поддерживать общий тонус ваших мышц', 'Питаемся в привычном режиме. Но исключаем животные жиры. На ночь хорошо будет маложирный творог с фруктами.', 0),
(13, 13, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 3, 1, '< 40 мин', 'Сегодняшний день тренировки заметно покажет, насколько вы преуспели в своем развитии', 'Наступает тот момент, когда тело привыкает к нагрузкам и ему требует больше белков и углеводов для полноценных тренировок и восстановления после. Кушаем больше мясных и рыбных продуктов сочетая их с гарниром/овощами. Предпочтения отдаём нежирным сортам рыбы. Добавляем в рацион отруби/орехи/ягоды.', 0),
(14, 14, 0, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 0, 0, '', 'Выходной', 'Делаем небольшой разгрузочных день! Утром и на ночь стакан нежирного кефира. А в течении дня лёгкую белковую пищу. Хорошо будет авокадо с сыром/оливковым маслом с различными гарнирами.', 0),
(15, 15, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 1, '< 40 мин', 'Глубокая проработка мышц ног', 'Предстоит побегать!) Значит ДО тренировки - лёгкий завтрак /перекус. Крепкий зелёный чай/чёрный кофе или нежирный творог. После - восполняем потраченные запасы. Питьевой йогурт без добавок будет идеален.', 0),
(16, 16, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 0, '< 30 мин', 'Укрепление всех мышечных групп организма', 'Не забываем про полезные углеводы! Добавляем в рацион кукурузу/картофель. В течение дня - хорошо будет чай с мёдом.', 0),
(17, 17, 0, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 0, 0, '', 'Выходной', 'Снова переходим на завтрак и обед (то есть от ужина постараться отказаться). Из гарнира - любые виды бобовых в сочетании с нежирной индейкой/уткой/курицей.', 0),
(18, 18, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 3, 0, '< 40 мин', 'Поддержание мышечного тонуса ног', 'Перед тренировкой за 30-40 мин съедаем кусок чёрного зернового хлеба или хлебец с чаем. После - восполняем баланс белков творогом с фруктами. Питаемся в привычном Вам режиме.', 0),
(19, 19, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 1, 2, '< 40 мин', 'Продолжаем развивать вашу двигательную активность', 'Не забываем про воду! От 2 литров в день. Стараемся легко поужинать, чтобы сохранить тонус и прорисовку мышц. Добавляем в рацион гречку.', 0),
(20, 20, 0, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 0, 0, '', 'Выходной', 'Даём послабления!) НО до середины дня ~ 15.00. Допускаются любые слабости)', 0),
(21, 21, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 1, '< 40 мин', 'Общая тренировка и хорошая проработка рук и мышц кора', 'Утром сразу стакан кефира. После тренировки - снова. Это поможет правильно "распределить" съеденное накануне. В течении дня хорошо будет выпить ещё 1-2 раза кефир. Едим сухие гарниры с нежирным мясом. Желательно исключить яйца. Допускается съесть кусок чёрного хлеба или хлебец.', 0),
(22, 22, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 3, 0, '< 50 мин', 'Тренировка на выносливость', 'Предстоит интенсивная тренировка! Для этого необходима лёгкость! Завтракаем хлебцем с сыром. После тренировки - чай/кофе/вода. Через час-1,5 кусок телятины/кролика/курицы с гречкой. ', 0),
(23, 23, 0, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 0, 0, '', 'Выходной', 'Отдыхаем и душой и телом! Стараемся есть лёгкие углеводы/растительные белки и жиры. Больше едим орехов/ягод/фруктов.', 0),
(24, 24, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 0, '< 40 мин', 'Поддержание мышечного тонуса ног', 'Перед интенсивными тренировками не пьём много воды. Перед - кушаем фрукт (лучше яблоко/груша/клубника) и закрепляем молочным белковым напитком, предпочтение отдаём сывороточному (не больше 1/2 стакана).', 0),
(25, 25, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 1, '< 40 мин', 'Хорошая проработка мышц пресса ног и рук', 'Нагрузка будет на пресс, значит не стоит "сильно" завтракать перед тренировкой. Предпочтение отдаём фруктам или авокадо. В течение дня стараемся не есть большими порциями. Едим в привычном Вам рационе. ', 0),
(26, 26, 0, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 0, 0, '', 'Выходной', 'Пополняем запасы белка! Утром и вечером хорошо будет маложирный творог со сметаной и орехами. Из мяса предпочтение говядина/баранина.', 0),
(27, 27, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 2, 0, '< 40 мин', 'Общая тренировка и хорошая проработка ног и мышц кора', 'Нужно подсушиться! Снова переходим только на завтрак и обед. Из гарнира - любые виды бобовых в сочетании с нежирной индейкой/уткой/курицей. У кого есть возможность - желательно отказаться в этот день от мяса полностью. Добавляем свёклу в рацион.', 0),
(28, 28, 1, 6, '2018-01-10 09:49:22', '2018-01-10 09:49:22', 3, 1, '< 60 мин', 'Финальный день твоей программы тренировок и сегодня контрольный тест (постарайся вспомнить результаты контрольного теста в 1-й день и сравни с сегодняшними результатами)', 'Продолжаем сушиться! Также не ужинаем (или ужинаем, но только творогом или питьевым йогуртом). Пьём воду/чай/кофе. Едим вкусные гарниры из круп и овощей. Снова желательно добавлять свёклу в обед. И проверяем результаты!', 0),
(29, 1, 1, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 2, 1, '< 20 мин', '1-й день программы тренировок задействует все основные мышцы в организме и сегодня контрольный тест – все упражнения делаете по максимуму, сколько сможете.\nПеред выполнением всех упражнений сразу или по отдельности рекомендуется сделать общую разминку, а после окончания выполнения тренировки – растяжку.', 'Начинаем неспешно , но продуктивно!) Кушаем в первый день маленькими порциями, стараемся есть больше белка (яйца, творог, сыр). Обедаем и ужинаем очень легко. Из мяса желательно кролик, курица или рыба. От гарнира желательно отказаться, заменить растительным белком (зелёная фасоль, бобовые). Перекусываем после тренировки молочным коктейлем или орехами.', 1),
(30, 2, 1, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 1, 0, '< 20 мин', '"Вспомогательная тренировка для укрепления всего организма. Развивается общая выносливость и помощь в ускорении обмена веществ. Каждое упражнение выполняется в течение 1 минуты, отдых между переходом на другое упражнение 10-15 сек. Выполняется 3 круга."', 'Перед тренировкой, за час - скушайте кусок чёрного зернового хлеба с чаем/водой. Это даст вас углеводный запас и энергию для Старта!) После тренировки (через мин 15)  желательно выпить молочный коктейль/фрукт или же выпить свежевыжатый сок . Все это пополнит запас гликогена быстро и безвредно для фигуры', 1),
(31, 3, 0, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 0, 0, '', 'Выходной', 'Даём мышцам отдых и восстанавливаем баланс полиненасыщенных жиров. Добавляем в еду ягоды/орехи. Больше томатов. И стараемся воздержаться от ужина в этот день.', 0),
(32, 4, 1, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 1, 0, '< 20 мин', 'Тренировка направлена на укрепление мышц ног и пресса.', 'Нагрузка на ноги, поэтому больше пьём воды! Перед тренировкой за час выпить стакан чёрного кофе или крепкий зелёный чай. После тренировки хорошо будет перекусить творогом (не жирный 5%) с 2-3 ч ложками мёда.', 0),
(33, 5, 0, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 0, 0, '', 'Выходной', 'Отдыхаем. В обед/ужин лучше всего красное мясо или бобовые/соя. Прием пищи 4 раза в день, НО маленькими порциями.  Кто хочет набрать мышечную массу, то 3 раза в день, стандартными порциями.', 0),
(34, 6, 1, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 2, 1, '< 40 мин', 'Более глубокая проработка мышечной ткани и хороший жиросжигательный эффект!', 'Помним! Жир горит с 20 минуты! Тренируемся умеренно, но продолжительно. Увеличиваем количество белка ДО и ПОСЛЕ тренировки. Исключаем в этот день сладкое полностью. Желательно отказаться от гарнира в пользу зелени.', 0),
(35, 7, 1, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 2, 0, '< 30 мин', 'Легкое повышение нагрузки на организм, переход на следующую ступень', 'Перед тренировкой, за час - скушайте кусок чёрного зернового хлеба с чаем/водой. Это даст вас углеводный запас и энергию для Старта!) После тренировки (через мин 15)  желательно выпить молочный коктейль/фрукт или же выпить свежевыжатый сок. Пополняем запасы гликогена в мышцах и даём витаминчиков.', 0),
(36, 8, 0, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 0, 0, '', 'Выходной', '««Важно не то, насколько усердно вы тренируетесь, а насколько полноценно вы отдыхаете». В этот день исключаем углеводы и животные жиры. Кушаем белок и растительные жиры (орехи/арахис/семена льна/вишня).».', 0),
(37, 9, 1, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 2, 1, '< 40 мин', 'Тренировка направлена на укрепление верхнего плечевого пояса и мышц пресса.', 'Животик должен быть плоским! Утром - стакан кефира/киселя. После тренировки еще один стакан кефира. Кушаем 3 раза в день и уходим с чувством "голода". Тратим ненужные отложения. На ночь - снова стакан кефира.', 0),
(38, 10, 1, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 2, 0, '< 30 мин', '10-й день тренировки помогает поддерживать общий тонус ваших мышц', 'Увеличиваем количество животного белка, особенно мясо/птица. Гарнира не более 2 столовых ложек на порцию.', 0),
(39, 11, 0, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 0, 0, '', 'Выходной', 'Отдыхаем. Пьём много воды в этот день. Исключаем мясо, едим гарнир (кроме картофеля)  и зелень.', 0),
(40, 12, 1, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 1, 0, '< 40 мин', '12-й день тренировки помогает поддерживать общий тонус ваших мышц', 'Питаемся в привычном режиме. Но исключаем животные жиры. На ночь хорошо будет маложирный творог с фруктами.', 0),
(41, 13, 1, 1, '2018-01-10 09:49:30', '2018-01-10 09:49:30', 3, 1, '< 40 мин', 'Сегодняшний день тренировки заметно покажет, насколько вы преуспели в своем развитии', 'Наступает тот момент, когда тело привыкает к нагрузкам и ему требует больше белков и углеводов для полноценных тренировок и восстановления после. Кушаем больше мясных и рыбных продуктов сочетая их с гарниром/овощами. Предпочтения отдаём нежирным сортам рыбы. Добавляем в рацион отруби/орехи/ягоды.', 0),
