INSERT INTO `programm_exercives` (`id`, `slug`, `name`, `description`, `created_at`, `updated_at`) VALUES
(1, '', 'Приседания на месте', 'Бедро ниже параллели, спина прямая.', '2017-11-25 10:55:41', '2017-11-25 10:55:41'),
(2, '', 'Выпады назад на месте', 'Бедро ниже параллели, колено не выходит вперед', '2017-11-25 10:55:41', '2017-11-25 10:55:41'),
